To create a simple screen scraper in Swift that parses HTML content, we will utilize the `URLSession` class to download the webpage and the `Specta` library to parse the HTML. Note that while this example demonstrates basic concepts, real-world applications may require additional error handling and optimization.

First, make sure you have Specta installed as mentioned earlier. Then, here's an example Swift code snippet for a basic screen scraper:

```swift
import Foundation
import Specta

func fetchAndParseWebpage(urlString: String) -> [String]? {
    guard let url = URL(string: urlString) else { return nil }

    URLSession.shared.dataTask(with: url)
       .resume()
       .validate()
       .continueWith({ task in
            // Check if there are no errors
            if task.isCancelled { return nil }

            // Fetch the response
            return task.resultHandler { response in
                guard let htmlData = response.data else { return nil }

                do {
                    // Parse the HTML content
                    let parsedHtml = try Specta.parse(htmlData)

                    // Extract all paragraph texts
                    var paragraphs = Array<String>()
                    for element in parsedHtml.elements {
                        if case.paragraph?(element) == element {
                            paragraphs.append(element.text?? "")
                        }
                    }

                    return paragraphs
                } catch {
                    print("Error parsing HTML: \(error)")
                    return nil
                }
            }
        })
       .resume()
}

// Usage
let urlString = "https://example.com"
if let paragraphs = fetchAndParseWebpage(urlString: urlString) {
    print(paragraphs)
} else {
    print("Failed to fetch or parse the webpage.")
}
```

